//pages/Nav.js
import React from "react";
import EventTable from "./contents/eventAndFestival/eventTable";
import HeaderMain from "./contents/header/headerMain";
import HeaderMenu from "./contents/header/headerMenu";
import './contents/eventAndFestival/eventAndFestivalPage.css';
function eventAndFestival() {
  let value = 1;

  function selectEvent() {
    value = 1;
  }
  function selectFestival() {
    value = 2;
  }


  return (

    <div className="eventAndFestivalPageMain">
      <div id="header">
        <HeaderMain />
        <HeaderMenu />
      </div>

      <button id = "selectEvent" onClick = {selectEventOrFestival}> 공연 행사 </button>
      <button id = "selectFest"  onClick = {selectEventOrFestival}> 문화 축제 </button>
      
      <div id="eventTable">
        {

          (function () {
            if (value == 1) return (<EventTable></EventTable>);
            if(value == 2) return (<div>응가</div>);
          })()
        }
        
      </div>



    </div>





  );
}

export default eventAndFestival;
